import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

import image25 from './Images/25.jpeg';
import image24 from './Images/24.jpeg';
import image23 from './Images/23.jpeg';

class App extends Component {


  render() {
    var ImageArray = [26];

    ImageArray[25] = image25;
    ImageArray[24] = image24;
    ImageArray[23] = image23;


  return (
    <div>
      <p>Hello World!</p>
      <img src = {ImageArray[24]} width = "400px" height = "400px"/>
    </div>
  );
}
}
export default App;
